import React from "react";

const SortArticles = () => {
  return (
    <form>
      Sort Articles By <br />
      <label>
        DATE <br />
        <input type="checkbox" name="date" value="Date" />
      </label>
      <label>
        Comments <br />
        <input type="checkbox" name="comment_count" value="Comments" />
      </label>
      <label>
        DATE
        <input type="checkbox" name="Date" value="Date" />
      </label>
    </form>
  );
};

export default SortArticles;
